package com.ezen.haha.mypage;

public class AddressListDTO {
	String adlistname;
	String id;
	String tel;
	String address;
	public AddressListDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getAdlistname() {
		return adlistname;
	}
	public void setAdlistname(String adlistname) {
		this.adlistname = adlistname;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getTel() {
		return tel;
	}
	public void setTel(String tel) {
		this.tel = tel;
	}
	public String getAddress() {
		return address;
	}
	public void setAddress(String address) {
		this.address = address;
	}
	
	
}


